import React, {useState} from 'react';

// Css
import './LocationChange.css';

// images
import Banglore from '../../assets/Images/banglore.png';
import Mumbai from '../../assets/Images/mumbai.png';
import Pune from '../../assets/Images/pune.png';
import Delhi from '../../assets/Images/delhi.png';
import { Cross } from '../../assets';

const LocationChange = () => {

    const [cityActive, setCityActive] = useState(false);
    if(!cityActive){
        document.body.remove(".active-modal");
    }

  
  return (
    <div className="container" >
        <div className="containerContent">
        <div className="locationContainer">
            <h1 className='selectCity'>Select your City</h1>
            <img src={Cross} alt="close" className='close' onClick={setCityActive}/>
            <div className="cityContainer">
                <div className="city banglore">
                    <img src={Banglore} alt="" className='cityImg'/>
                    <p className='cityName bangloreCity'>Banglore</p>
                </div>
                <div className="city mumbai">
                    <img src={Mumbai} alt="" className='cityImg'/>
                    <p className='cityName mumbaiCity'>Mumbai</p>
                </div>
                <div className="city pune">
                    <img src={Pune} alt="" className='cityImg'/>
                    <p className='cityName puneCity'>Pune</p>
                </div>
                <div className="city delhi">
                    <img src={Delhi} alt="" className='cityImg'/>
                    <p className='cityName delhiCity'>Delhi</p>
                </div>
            </div>
        </div>
        </div>
    </div>
  )
}

export default LocationChange;
